import useFetch from "./useFetch";

const SearchBlog = () => {
    const {blog, error, isPending} = useFetch('http://localhost:8000/blogs/');

    
    return ( 
        <div className="search">
            <h2>Buscar blog</h2>
            <form action="/" method="get">
            <label htmlFor="header-search">
            </label>
            <input
                type="text"
                id="header-search"
                placeholder="Introduce tu consulta"
                name="s" 
            />
            <button type="submit">Buscar</button>
            <ul>
                {blog.map((blog) => (
                    <li key={blog.id}>{blog.name}</li>
                ))}
            </ul>

        </form>
        </div>
     );

}
 
export default SearchBlog;
